{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/berkayouzhan/cyclistic-bike-share-by-berkay-oguzhan?scriptVersionId=155978796\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown"},{"cell_type":"markdown","id":"9323afd4","metadata":{"papermill":{"duration":0.012912,"end_time":"2023-12-21T18:12:06.179304","exception":false,"start_time":"2023-12-21T18:12:06.166392","status":"completed"},"tags":[]},"source":["# Introduction\n","\n","This case study is an integral component of the Google Data Analytics Professional Certificate, comprehensively addressing the data analysis process in alignment with Google's framework:\n","\n","1. Ask\n","1. Prepare\n","1. Process\n","1. Analyze\n","1. Share\n","1. Act\n","\n","Within the confines of this notebook, I elucidate my systematic approach to data analysis, meticulously adhering to the aforementioned steps. The focal point of this case study is an examination of the business quandary faced by Cyclistic, a hypothetical bike-sharing service operating in Chicago. The dataset utilized for this analysis is procured from Motivate International Inc, pursuant to the agreed terms.\n","\n","**Case Study Challenge**\n","\n","Cyclistic has presented the challenge of delving into their user data to discern the primary distinctions in bike usage and behavioral patterns between two user categories: \"casual\" users, who opt for a single ride or full-day pass, and \"member\" users, who subscribe annually to access the service."]},{"cell_type":"markdown","id":"fcedb30f","metadata":{"papermill":{"duration":0.013007,"end_time":"2023-12-21T18:12:06.204362","exception":false,"start_time":"2023-12-21T18:12:06.191355","status":"completed"},"tags":[]},"source":["# Ask\n","# \n","\n","**Key Objective:** Formulate the business question aligned with stakeholder needs.\n","\n","Cyclistic, since its inception in 2016, has burgeoned into a prominent bike-sharing service with a fleet exceeding 5,800 bikes sprawled across Chicago. The service boasts three distinct pricing plans catering to a diverse rider demographic:\n","\n","1. Single-Ride Pass\n","2. Full-Day Pass\n","3. Annual Membership\n","\n","**These pricing structures are tailored to accommodate two primary categories of riders:**\n","\n","1. Casual riders, valuing the flexibility of single-ride or full-day passes.\n","2. Members, committed to an annual subscription.\n","\n","Lily Moreno, the Director of Marketing, has set a strategic objective to convert casual riders into annual members. To facilitate this transition, a comprehensive report has been devised to elucidate insights into Cyclistic's ridership. As a member of the data analytics team, my assigned task is to discern the differential usage patterns between casual and annual members of the Cyclistic service.\n","\n","**Deliverables:**\n","Articulate the business task: Support the marketing team in their initiative to convert casual riders into annual members by pinpointing significant disparities in how Cyclistic riders engage with the service in the city of Chicago."]},{"cell_type":"markdown","id":"187a2795","metadata":{"papermill":{"duration":0.01307,"end_time":"2023-12-21T18:12:06.230002","exception":false,"start_time":"2023-12-21T18:12:06.216932","status":"completed"},"tags":[]},"source":["# Prepare\n","\n","**Key Objective:** Scrutinize the data source and attain a comprehensive understanding of its structure.\n","\n","The dataset employed in this case study is sourced from a publicly accessible repository hosting monthly datasets generously provided by Motivate International Inc. These datasets, available for download [here](link to the dataset), are formatted as 'csv' files.\n","\n","For the purpose of this analysis, datasets spanning the past 12 months have been procured from the Kaggle dataset"]},{"cell_type":"code","execution_count":1,"id":"58e4f3d1","met