":"2023-12-21T18:12:41.234283","status":"completed"},"tags":[]},"source":["# Process\n","\n","**Key Objective:** Refine the datasets to ensure the precision of the analysis.\n","\n","To initiate the data refinement process, the initial step involves consolidating all the individual trips datasets into a unified dataset. This amalgamation facilitates a comprehensive and cohesive analysis by consolidating relevant information from various sources.\n","\n","Lets merge the datasets below:"]},{"cell_type":"code","execution_count":4,"id":"9a284d10","metadata":{"execution":{"iopub.execute_input":"2023-12-21T18:12:41.289139Z","iopub.status.busy":"2023-12-21T18:12:41.286668Z","iopub.status.idle":"2023-12-21T18:12:49.406679Z","shell.execute_reply":"2023-12-21T18:12:49.404583Z"},"papermill":{"duration":8.142812,"end_time":"2023-12-21T18:12:49.410873","exception":false,"start_time":"2023-12-21T18:12:41.268061","status":"completed"},"tags":[]},"outputs":[],"source":["# Merging\n","trips <- bind_rows(data1, data2, data3,\n","                data4, data5, data6, \n","                data7, data8, data9, \n","                data10, data11, data12)"]},{"cell_type":"code","execution_count":5,"id":"86dd8cb2","metadata":{"execution":{"iopub.execute_input":"2023-12-21T18:12:49.447614Z","iopub.status.busy":"2023-12-21T18:12:49.445783Z","iopub.status.idle":"2023-12-21T18:13:24.208633Z","shell.execute_reply":"2023-12-21T18:13:24.206188Z"},"papermill":{"duration":34.784637,"end_time":"2023-12-21T18:13:24.211927","exception":false,"start_time":"2023-12-21T18:12:49.42729","status":"completed"},"tags":[]},"outputs":[],"source":["# Creating month column\n","trips$month <- format(as.Date(trips$started_at), \"%b\")\n","\n","# Creating year column\n","trips$year <- format(as.Date(trips$started_at), \"%Y\") \n","\n","# Creating day of the week column\n","trips$day_of_week <- format(as.Date(trips$started_at), \"%A\") \n","\n","# Creating hour column\n","trips <- trips %>%\n","    mutate(hour = strftime(trips$ended_at, \"%H\"))\n","\n","# Creating ride length column (in minutes)\n","trips$ride_length <- (as.double(difftime(trips$ended_at, trips$started_at))) / 60\n","\n","# Creating ride distance column (in km)\n","trips$ride_distance <- distGeo(matrix(c(trips$start_lng, trips$start_lat), ncol = 2),\n","                              matrix(c(trips$end_lng, trips$end_lat), ncol = 2))\n","trips$ride_distance <- trips$ride_distance / 1000\n","\n","# Ordering day_of_week column\n","trips$day_of_week <- ordered(trips$day_of_week, levels = c(\"Monday\", \"Tuesday\", \"Wednesday\", \n","                                                           \"Thursday\", \"Friday\", \"Saturday\", \n","                                                           \"Sunday\"))\n","\n","# Ordering month column\n","trips$month <- ordered(trips$month, levels = c(\"Jan\", \"Feb\", \"Mar\", \"Apr\", \"May\", \"Jun\",\n","                                               \"Jul\", \"Aug\", \"Sep\", \"Oct\", \"Nov\", \"Dec\"))\n","\n","# Renaming columns\n","names(trips)[2] <- 'bike'\n","names(trips)[13] <- 'user'\n","\n","# Remove rows with NA's\n","trips <- drop_na(trips)\n","\n","# Remove rows where rides were negative\n","trips <- trips[!trips$ride_length < 1,]\n","\n","# Remove rows where rides were above 1 day\n","trips <- trips[!trips$ride_length > 1440,]\n"]},{"cell_type":"markdown","id":"95eb8b16","metadata":{"papermill":{"duration":0.016738,"end_time":"2023-12-21T18:13:24.247951","exception":false,"start_time":"2023-12-21T18:13:24.231213","status":"completed"},"tags":[]},"source":["# Analysis\n","\n","**Key Objective:** Employ the data to identify noteworthy trends and insights.\n","\n","**1. Temporal Features:**\n"," \n","Created 'month,' 'year,' 'day_of_week,' and 'hour' columns for enhanced temporal analysis.\n","\n","**2. Ride Metrics:**\n","\n","Calculated 'ride_length' (duration in minutes) and 'ride_distance' (geographical distance in kilometers) for each ride.\n","\n","**3. Temporal and Spatial Ordering:**\n","\n","Ordered 'day_of_week' and 'month' columns for structured analysis.\n","\n","**4. Column Renaming:**\n","\n","Renamed columns for clarity ('bike' and 'user').\n","\n","**5. Handling Missing Data:**\n","\n","Removed rows with missing values to ensure data integrity.\n","\n","**6. Handling Outliers:**\n","\n","Excluded rows with negative or excessively long ride lengths (above 1 day) for dataset reliability.\n","This streamlined preprocessing sets the stage for focused analysis, ready to unveil key patterns and insights in Cyclistic's ridership data."]},{"cell_type":"code","execution_count":6,"id":"ee33e31a","metadata":{"execution":{"iopub.execute_input":"2023-12-21T18:13:24.284695Z","iopub.status.busy":"2023-12-21T18:13:24.282579Z","iopub.status.idle":"2023-12-21T18:13:25.652753Z","shell.execute_reply":"2023-12-21T18:13:25.650794Z"},"papermill":{"duration":1.391948,"end_time":"2023-12-21T18:13:25.655843","exception":false,"start_time":"2023-12-21T18:13:24.263895","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["<table class=\"dataframe\">\n","<caption>A tibble: 2 × 2</caption>\n","<thead>\n","\t<tr><th scope=col>user</th><th scope=col>percent_total</th></tr>\n","\t<tr><th scope=col>&lt;chr&gt;</th><th scope=col>&lt;dbl&gt;</th></tr>\n","</thead>\n","<tbody>\n","\t<tr><td>casual</td><td>0.4416798</td></tr>\n","\t<tr><td>member</td><td>0.5583202</td></tr>\n","</tbody>\n","</table>\n"],"text/latex":["A tibble: 2 × 2\n","\\begin{tabular}{ll}\n"," user & percent\\_total\\\\\n"," <chr> & <dbl>\\\\\n","\\hline\n","\t casual & 0.4416798\\\\\n","\t member & 0.5583202\\\\\n","\\end{tabular}\n"],"text/markdown":["\n","A tibble: 2 × 2\n","\n","| user &lt;chr&gt; | percent_total &lt;dbl&gt; |\n","|---|---|\n","| casual | 0.4416798 |\n","| member | 0.5583202 |\n","\n"],"text/plain":["  user   percent_total\n","1 casual 0.4416798    \n","2 member 0.5583202    "]},"metadata":{},"output_type":"display_data"}],"source":["# Calcul