ituting nearly 70% of all rides. This suggests a consistent preference for classic bikes among Cyclistic users.\n","\n","Docked bikes, which are exclusively available to casual customers, are utilized for a significant portion of rides, reflecting the popularity of this bike type among casual users.\n","\n","* Temporal Patterns:\n","\n","Most rides took place on the weekend, indicating a higher demand for Cyclistic services during leisure periods.\n","The summer months emerge as the peak period for rides, suggesting a seasonal trend with increased bike usage during warmer weather.\n","\n","These key findings provide valuable insights into the usage patterns, preferences, and temporal trends within Cyclistic's ridership data. Understanding these patterns can inform strategic decisions and initiatives to enhance user experience and optimize service offerings."]},{"cell_type":"markdown","id":"0426e359","metadata":{"papermill":{"duration":0.019518,"end_time":"2023-12-21T18:13:31.967226","exception":false,"start_time":"2023-12-21T18:13:31.947708","status":"completed"},"tags":[]},"source":["# Share\n","**Key Objective:** Visualize the data to share with stakeholders."]},{"cell_type":"code","execution_count":19,"id":"7fbbad39","metadata":{"execution":{"iopub.execute_input":"2023-12-21T18:13:32.010387Z","iopub.status.busy":"2023-12-21T18:13:32.008582Z","iopub.status.idle":"2023-12-21T18:13:32.841768Z","shell.execute_reply":"2023-12-21T18:13:32.83863Z"},"papermill":{"duration":0.859325,"end_time":"2023-12-21T18:13:32.846049","exception":false,"start_time":"2023-12-21T18:13:31.986724","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["Warning message:\n","“\u001b[1m\u001b[22mUsing `size` aesthetic for lines was deprecated in ggplot2 3.4.0.\n","\u001b[36mℹ\u001b[39m Please use `linewidth` instead.”\n"]},{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA8AAAAPACAIAAAB1tIfMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdd3wT5eMH8Ocy23TvvekEStlDKH