,"labs(title = \"Monthly Rides\",\n","    caption = \"Data: Motivate International\", subtitle = \"The summer months have the most number of rides\",\n","    x = \"Month\", y = \"Number of Rides\") +\n","theme_minimal() +\n","theme(plot.title = element_text(size = 22, color = \"#42a0ab\", face = \"bold\"), \n","    plot.subtitle = element_text(size = 14, color = \"grey20\", face = \"bold\"), \n","    plot.caption = element_text(size = 8, color = \"grey35\"),\n","    legend.title = element_text(size = 16, face = \"bold\", color = \"#42a0ab\"),\n","    legend.text = element_text(size = 14, color = \"grey20\"),\n","    axis.title.x = element_text(size = 15, color = \"#42a0ab\", face = \"bold\"), \n","    axis.title.y = element_text(size = 15, color = \"#42a0ab\", face = \"bold\"),\n","    axis.text.x = element_text(size = 10, color = \"grey20\", face = \"bold\"),\n","    axis.text.y = element_text(size = 10, color = \"grey20\", face = \"bold\"))"]},{"cell_type":"markdown","id":"0011ed7a","metadata":{"papermill":{"duration":0.032361,"end_time":"2023-12-21T18:13:38.066873","exception":false,"start_time":"2023-12-21T18:13:38.034512","status":"completed"},"tags":[]},"source":["### Supporting Visualizations:\n","\n","#### 1. **Distribution of Riders:**\n","   - Visualization: Pie chart or bar chart showing the distribution of casual and annual members among all riders.\n","   - Key Insight: Highlight the percentage of casual and annual members in the overall ridership.\n","\n","#### 2. **Bike Usage by User Type:**\n","   - Visualization: Bar chart displaying the percentage of bike types used by casual and annual members.\n","   - Key Insight: Identify the preferred bike types for each user group.\n","\n","#### 3. **Average Ride Time and Distance:**\n","   - Visualization: Side-by-side bar charts showing the average ride time and distance for casual and annual members.\n","   - Key Insight: Explore how ride durations and distances differ between the two user types.\n","\n","#### 4. **Rides Throughout the Day:**\n","   - Visualization: Line or bar chart illustrating the number of rides throughout the day for casual and annual members.\n","   - Key Insight: Identify peak hours for both user types and any variations in usage patterns.\n","\n","#### 5. **Rides by Weekday and Month:**\n","   - Visualization: Heatmap or stacked bar charts showing the distribution of rides by weekday and month.\n","   - Key Insight: Highlight trends in usage based on weekdays and months.\n","\n","### Key Findings:\n","\n","#### 1. **User Distribution:**\n","   - Casual riders constitute the majority of recorded rides over the past twelve months, with annual members making up the remaining portion.\n","\n","#### 2. **Bike Usage Patterns:**\n","   - Casual riders predominantly choose the classic bike for their rides, representing a significant majority.\n","\n","#### 3. **Average Ride Time and Distance:**\n","   - Casual riders spend, on average, twice as much time on rides compared to annual members and cover slightly longer distances.\n","\n","#### 4. **Peak Usage Hours:**\n","   - Rides peak during the early evening hours, indicating a preferred time for both casual and annual members.\n","\n","#### 5. **Seasonal and Weekly Variations:**\n","   - Most rides took place on the weekends, and there is a noticeable increase during the summer months.\n","\n","These key findings and visualizations provide a comprehensive overview of the Cyclistic bike-sharing service's user behavior, preferences, and usage patterns."]},{"cell_type":"markdown","id":"141376a8","metadata":{"papermill":{"duration":0.045453,"end_time":"2023-12-21T18:13:38.151415","exception":false,"start_time":"2023-12-21T18:13:38.105962","status":"completed"},"tags":[]},"source":["# Act\n","\n","#### 1. **Seasonal Advertising Campaign:**\n","   - **Action:** Launch a targeted advertising campaign specifically designed for casual riders leading into the summer months.\n","   - **Rationale:** Capitalize on the increased ridership during the summer and promote the benefits of Cyclistic membership.\n","\n","#### 2. **Membership Conversion Promotions:**\n","   - **Action:** Implement promotions for casual riders, such as a free trial or discounted membership fees, to showcase the cost savings associated with becoming an annual member.\n","   - **Rationale:** Incentivize casual riders to explore the advantages of becoming members and highlight the financial benefits they can enjoy.\n","\n","#### 3. **Reward Program for Members:**\n","   - **Action:** Establish a rewards program exclusively for annual members, offering perks or discounts for consistent usage and loyalty.\n","   - **Rationale:** Encourage existing members to continue their subscription while creating an attractive incentive for casual riders to transition to annual memberships.\n","\n","#### 4. **Docked Bikes for Annual Members:**\n","   - **Action:** Make docked bikes available as part of the annual membership package to enhance the service offering.\n","   - **Rationale:** Adding docked bikes to the annual membership provides additional convenience and flexibility, making the membership more appealing to a broader audience.\n","\n","These recommendations aim to strategically target casual riders, offering them compelling reasons to transition to annual memberships while simultaneously enhancing the overall value proposition for existing members. Implementing these actions can contribute to increased membership conversion rates and improved user satisfaction."]},{"cell_type":"markdown","id":"7d895a87","metadata":{"papermill":{"duration":0.038067,"end_time":"2023-12-21T18:13:38.235337","exception":false,"start_time":"2023-12-21T18:13:38.19727","status":"completed"},"tags":[]},"source":["# THANK YOU FOR READING !!!"]},{"cell_type":"markdown","id":"0270de75","metadata":{"papermill":{"duration":0.038959,"end_time":"2023-12-21T18:13:38.306542","exception":false,"start_time":"2023-12-21T18:13:38.267583","stat